import React from 'react';
import { Link } from 'react-router-dom';
import './Tipo.css';
import SabosImg from '../../assets/1sabos.png';
import SaboresImg from '../../assets/2sabores.png';
import returnImg from '../../assets/return.png';


const Preferential = () => {
  return (
    <div className="Tipo">

      <div className="tipo_main">
      <Link className="return" to="/preferential">
                <img src={returnImg} className="" alt="logo" />
            </Link>
       <h1> Escolha o tipo da pizza </h1>
        <div className="tipos">

          <div>
            <Link className="Sabos" to="/tipo">
                <img src={SabosImg} className="" alt="logo" />
            </Link>
            <h2> 1 Sabos </h2>
          </div>

          <div>
            <Link className="Sabores2" to="/tipo">
                <img src={SaboresImg} className="" alt="" />
            </Link>
             <h1> 2 Sabores </h1>
             <h2> VALOR : 24 $R </h2> 
          </div>

        </div>
        </div>

    </div>
  );
}

export default Preferential;
